function findLastNameStrokeByCharacter(lastName) {
    var totalStroke = 0;
    for(var i = 0; i < lastName.length; i++){
        for(var j = 0; j < kangxi.length; j++){
            var data = kangxi[j];
            if (data.character === lastName[i]) {
              totalStroke += data.stroke;
            }            
        }
    }
    return totalStroke;
}
function findStrokeByCharacter(nameChar) {
    var Stroke = 0;
    for(var i = 0; i < kangxi.length; i++){
        var data = kangxi[i];
        if (data.character === nameChar) {
            Stroke = data.stroke;
     }            
        
    }
    return Stroke;
}




